import React, {Component} from 'react'
var donkeyImg = "data:image/jpeg;base64,"

class FriendsBox extends Component {

  followerCards = () => {

    if (this.props.followers){
       return this.props.followers.map(follower => {
        return (
          <div class="card" style={{width: "18rem"}}>
          <img class="card-img-top" src={donkeyImg} alt="Card image cap"/>
          <div class="card-body">
            <h5 class="card-title">Name: {follower.name}</h5>
            <p class="card-text">I drive a: {follower.car}</p>
            <a href={`http://localhost:3000/api/v1/users/${follower.id}`} class="btn btn-primary">Check out my profile!</a>
          </div>
        </div>)
      })
    }
  }

  render(){
    return(
      <div className="follower-container">
      <h1>Check out yo friends!</h1>
        {this.followerCards()}
      </div>
    )
  }

}
export default FriendsBox
